import React, { useContext, useEffect } from 'react'
import HarvestPhotos from './Harvest'
import {HarvestContext} from '../context/HarvestProvider'
import {v4} from 'uuid'






function HarvestList() {

    const { harvests, getAllHarvests} = useContext(HarvestContext)

    useEffect(() => {

        getAllHarvests([])

    }, []
    )

    return (
        <div>

            <h1>Current Available Harvests</h1>
            { harvests.map(harvest => {<Harvest image={harvest.harvestImg} label={harvest.body} farmer={harvest.userHandle} {...harvest}
                key={v4()} />})}
        </div>
    )
}

export default HarvestList
